import React from 'react';

function SearchBlockComp() {

    function submit(e){
        e.preventDefault();

    }

    return (
        <>
            <form onSubmit = { submit }>
                <p>資料總筆數</p>
            </form>
        </>
    );
}

export default SearchBlockComp;
